@import '../../css/element.scss';
.panel{
    @include panel;
    >h4{
        display: none;
    }
    .content{
        @include flex;
        margin-top: 100px;
        .user{
            @include flex(row);
            justify-content: space-around;
            height: 140px;
            line-height: 140px;
            img{
                width: 100px;
                height: 100px;
                margin-top: 20px;
                padding-left: 25px;
                padding-right: 30px;
            }
            span{
                font-size: 32px;
            }
            .name{
                flex: 2;
                color: #666;
            }
            .out{
                padding-right: 25px;
                color: #ef7d00;
            }
        }
    }
}
